mauvais_points:
La porte de la chambre était ouverte quand je suis arrivée; une bouteille d'eau sur la table était entamée.
Pas de savon dans le support de la douche. 
Personnel peu attentif au client limite méprisant;

Personnel pas toujours à l'écoute!
Nous avons attendu nos plats très longtemps au restaurant.
Déçus par rapport à nos précédents séjours dans cet établissement;

- l’accueil très désorganisée (après avoir passé plus d’une 40taine de minutes pour faire le Check-in, j’ai dû en plus changer de chambre 2 fois pour enfin trouver un lit [qui d’ailleurs j’avais déjà réservé par booking]);
- le manque de propreté des espaces communs;
- qu’un toilette disponible dans les dortoirs;
- petit-déjeuner simple en fruits et boissons, sans parler des croissants payants à part.

bons_points:
Déjeuner bon. 
Emplacement bon par rapport à mon but; 
chambre: correcte mais comme dans beaucoup d'hôtel, mal isolée phonétiquement . réveillée à 1h du matin par un bruit de douche. Merci!

mauvais_points:
* Chambre pas prête pour 14h comme indiqué sur Booking (j'ai dû me changer comme un réfugié entre la poire et le fromage devant le bar et dans les WC) ;
* En rentrant à minuit samedi soir en pleine canicule, je demande au maître d'hôtel s'il peut nous faire monter de l'eau avec des glaçons et du citron, il nous réponds que nous avons un mini-bar et Uber Eats ;
* Samedi après-midi, nous revenons à 16h, la chambre n'était pas faite alors que nous l'avions quittée à 10h30 le matin avec l'indication de la faire --> on nous a répondu que l'hôtel donnait priorité aux nouveaux arrivants et qu'ensuite les clients en-cours étaient traités !
Plus de 600 EUR pour deux nuits pour être traités comme des clients de seconde zone, nous considérons que la vie est trop courte pour se faire traiter ainsi.

L'accueil de la réception. Tentative de faire c'est la réception qui vient au client, mais le personnel est scotché sur le pupitre pendant que l'on attend...
Annulation de ma chambre, alors que j'ai appelé pour dire que j'arriverais très tard;
La chambre est dépourvu de poubelle... et quand on en dépose une, elle n'est pas récupérée...
